import React from 'react';
import { getUserNameById } from '../utils/helpers';
import { PRIORITY_LEVELS } from '../utils/constants';

function TicketCard({ ticket, users }) {
  const userName = getUserNameById(users, ticket.userId);

  return (
    <div className="ticket-card">
      <h3>{ticket.title}</h3>
      <p><strong>Status:</strong> {ticket.status}</p>
      <p><strong>User:</strong> {userName}</p>
      <p><strong>Priority:</strong> {PRIORITY_LEVELS[ticket.priority]}</p>
      {ticket.tag && (
        <p><strong>Tags:</strong> {ticket.tag.join(', ')}</p>
      )}
    </div>
  );
}

export default TicketCard;
